import React from 'react';
import { Link } from 'react-router-dom';
import one from './one.jpg';
import two from './two.jpg';
import three from './three.jpg';


export default class PortsProtocols extends React.Component {
	render() {
		return (
			<>

			<center>
				<img src={one}
				style={{"height": "250px"}}/>
				<p></p>
				<img src={two}
				style={{"height":"240px"}}/>
				<p></p>
				<img src={three}
				style={{"height":"240px"}}/>
				<p></p>
			</center>

			</>
		);
	}
}
